import React from "react";
import javascript from "./images/javascript.png";
import Card from "./Components/Card";
import java from "./images/java.png";

function App() {
    return (
        <>
            <div className="cards">
                <Card images={javascript} title="JavaScript" type="Frontend and Backend" />
                <Card images={java} title="Java" type=" Backend" />
                <Card images={phthon} title="Phthon" type=" Backend" />
            </div>
        </>
    )
};


export default App;
